INSERT INTO equipment (capacity, id, name, specialization, room_name, description) VALUES (10, 1, 'Gym', 'PHYSICAL_THERAPIST', 'Physiotherapy Suite', 'This gym is equipped for physical therapy and is likely to include a variety of exercise equipment such as treadmills, stationary bikes, free weights, and resistance bands. It is designed to accommodate physical rehabilitation needs, strength training, and flexibility exercises under the guidance of a physical therapist.'); --physical therapy
INSERT INTO equipment (capacity, id, name, specialization, room_name, description) VALUES (2, 2, 'Electrical Muscle Stimulation unit', 'ELECTROTHERAPIST', 'Electrotherapy Zone', 'The EMS unit is a device used by electrotherapists to deliver electrical impulses to stimulate muscle contractions. It''s often used in rehabilitation after injury, for pain relief, or even in muscle strengthening and training. The unit''s settings can be adjusted for intensity and frequency to suit individual patient needs.');
INSERT INTO equipment (capacity, id, name, specialization, room_name, description) VALUES (2, 3, 'Cryotherapy machine', 'CRYOTHERAPIST', 'CryoRecovery Room', 'This machine is used for cryotherapy, involving exposure to extremely cold temperatures for a few minutes. Cryotherapy can reduce inflammation, pain, and muscle spasms and is often used in sports medicine and recovery therapy. The cryotherapy machine could be a full-body chamber or localized treatment device.');
INSERT INTO equipment (capacity, id, name, specialization, room_name, description) VALUES (4, 4, 'Hydrotherapy pool', 'HYDROTHERAPIST', 'Hydro Rehab Pool', 'A hydrotherapy pool is designed for therapeutic exercises in a water-based environment. The buoyancy, resistance, and warmth of the water can help in pain relief, improving joint mobility, and enhancing rehabilitation from injuries. It''s particularly beneficial for patients with arthritis, chronic pain, and neurological conditions.');
INSERT INTO equipment (capacity, id, name, specialization, room_name, description) VALUES (4, 5, 'Paraffin wax baths and infrared lamp', 'THERMOTHERAPIST', 'Thermal Wellness Space', 'This equipment is used for thermotherapy. Paraffin wax baths provide heat therapy for pain relief and to soften the skin, often used for hands and feet. They are beneficial for conditions like arthritis or fibromyalgia. The infrared lamp emits infrared light to penetrate deep into tissues, easing muscle aches, increasing circulation, and relaxing the muscles.');
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Rotator cuff tear', 'Physical therapy focuses on strengthening the shoulder muscles, improving range of motion, and reducing pain through targeted exercises.', '#5G3Y4', 12, 'shoulder', 1);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Frozen shoulder', 'Therapy aims to restore shoulder mobility through stretching and range of motion exercises.', '#7Z8V8', 10, 'shoulder', 2);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Tennis elbow', 'Treatment includes strengthening forearm muscles.', '#1V2V2', 8, 'arm', 3);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Golfers elbow', 'Physical therapy involves strengthening and stretching exercises for the forearm muscles and may include modalities for pain relief.', '#8I5F5', 8, 'arm', 4);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Biceps tendinitis', 'Therapy focuses on strengthening the biceps and shoulder muscles while reducing inflammation through modalities.', '#4C7X3', 10, 'arm', 5);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Carpal tunnel', 'Exercises to improve wrist and hand flexibility, along with techniques to relieve pressure on the median nerve.', '#1R2Y1', 8, 'hand', 6);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (3, 'Arthritis pain management', 'Cryotherapy helps alleviate arthritis pain by numbing the affected joints, reducing inflammation, and temporarily easing discomfort and stiffness.', '#6F6P9', 8, 'hand', 7);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (3, 'Tendinitis', 'Cryotherapy can be employed to reduce inflammation and alleviate pain associated with tendinitis by constricting blood vessels and diminishing tissue swelling in the affected area.', '#1G8Z3', 10, 'hand', 8);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (4, 'Osteoarthritis management', 'Hydrotherapy provides a low-impact environment for joint mobility exercises and pain relief, helping individuals with osteoarthritis improve joint function and reduce discomfort.', '#4D5C2', 8, 'hand', 9);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (5, 'Bursitis', 'Thermotherapy may be used to alleviate pain and inflammation associated with bursitis by increasing blood flow and promoting the relaxation of affected tissues, often applied through warm compresses or therapeutic ultrasound.', '#4N8P5' , 8, 'hand', 10);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (5, 'Rheumatoid Arthritis', 'Thermotherapy, such as paraffin wax baths, can help ease joint stiffness and reduce pain in individuals with rheumatoid arthritis by enhancing joint flexibility and reducing inflammation.', '#7R3N6', 8, 'hand', 11);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'ACL injury', 'Rehabilitation includes exercises to strengthen the knee and improve stability, often following surgical repair.', '#3H4O2', 20, 'leg', 12);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Meniscus tear', 'Therapy emphasizes range of motion exercises and strengthening of the muscles around the knee.', '#6F2G1', 8, 'leg', 13);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'IT band syndrome', 'Treatment involves stretching and strengthening the IT band and hip muscles.', '#8L2Q4', 8, 'leg', 14);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Shin splints', 'Rehabilitation focuses on reducing inflammation and improving lower leg strength and flexibility.', '#7P3Y5', 6, 'leg', 15);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Stress fractures', 'Rest and gradual return to weight-bearing activities are essential, along with exercises to maintain bone density.', '#9M8D2', 10, 'leg', 16);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Hip bursitis', 'Exercises to improve hip muscle strength and flexibility, along with modalities for pain management.', '#2T8L4', 10, 'leg', 17);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Ankle sprain', 'Therapy includes balance exercises, strengthening the ankle, and improving flexibility.', '#6W1E6', 8, 'foot', 18);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Plantar fasciitis ', 'Treatment involves stretching and strengthening exercises for the calf and foot muscles, along with modalities for pain relief.', '#6B5Q3', 8, 'foot', 19);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Achilles tendinitis ', 'Therapy aims to strengthen the calf muscles and Achilles tendon while reducing inflammation.', '#5C3G3', 12, 'foot', 20);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Lumbar herniated disc ', 'Physical therapy focuses on relieving pain and improving spinal stability through exercises.', '#3N4P6', 14, 'lower torso', 21);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Sciatica', 'Treatment involves exercises to alleviate sciatic nerve compression and improve lumbar spine function.', '#9P1H4', 7, 'lower torso', 22);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (4, 'Chronic low back pain management', 'Hydrotherapy involves warm water exercises and aquatic therapy techniques to improve flexibility, reduce pain, and enhance core strength in individuals with chronic low back pain.', '#4W3F2', 10, 'lower torso', 23);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Scoliosis', 'Therapy includes exercises to improve spinal alignment, flexibility, and muscle balance.', '#5R9N7', 8, 'upper torso', 24);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Postural disorders', 'Treatment includes exercises to correct posture and improve muscle balance to relieve pain and prevent future issues.', '#8K1H7', 7, 'upper torso', 25);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Cervical radiculopathy ', 'Rehabilitation aims to reduce neck pain and nerve symptoms through neck exercises and modalities.', '#8G5H3', 8, 'head', 26);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (1, 'Whiplash', 'Physical therapy focuses on neck strengthening and range of motion exercises to alleviate pain and stiffness.', '#8H6H1', 10, 'head',27);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (2, 'Post-Operative rehabilitation', 'EMS therapy aids in muscle activation and circulation for post-operative patients, helping to prevent muscle atrophy and accelerate recovery through controlled electrical muscle contractions.', '#3J6K2', 12, 'any', 28);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (2, 'Stroke rehabilitation', 'EMS can be used to stimulate paralyzed or weakened muscles, aiding in muscle re-education and motor function recovery for stroke survivors.', '#9P3R1', 20, 'any', 29);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (2, 'Muscle atrophy prevention', 'EMS assists in maintaining muscle strength and mass in individuals with limited mobility, such as bedridden or immobilized patients, by providing passive muscle contractions', '#2J6Z7', 8, 'any', 30);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (2, 'Chronic pain management', 'EMS therapy can help manage chronic pain conditions by stimulating endorphin release, reducing pain perception, and improving blood circulation in targeted areas.', '#7X4N5', 6, 'any', 31);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (3, 'Post-Operative swelling minimization', 'Cryotherapy involves the application of cold therapy to reduce post-operative swelling and inflammation, promoting faster healing and pain relief.', '#5M8P4', 6, 'any', 32);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (3, 'Acute sports injury', 'Cryotherapy is used immediately after an acute sports injury to minimize swelling, numb the area, and provide pain relief while facilitating faster recovery.', '#5Z9B5', 8, 'any', 33);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (4, 'Post-Stroke rehabilitation', 'Hydrotherapy offers a supportive and buoyant environment for stroke survivors to work on regaining ', '#8D2H9', 20, 'any', 34);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (4, 'Post-Operative Rehabilitation', 'Hydrotherapy can aid in the recovery process after surgery by offering a gentle way to regain mobility, reduce swelling, and improve overall conditioning through aquatic exercises and controlled movements in warm water.', '#5I9K8', 12, 'any', 35);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (5, 'Muscle spasms and tension management', 'Thermotherapy in a wax bath involves immersing affected muscles in warm wax to relax and soothe muscle spasms, reduce tension, and promote blood flow for pain relief.', '#6L2M9', 6, 'any', 36);
INSERT INTO therapy_type (required_equipment_id, name, description, therapy_Code, num_of_sessions, body_part, id) VALUES (5, 'Chronic muscle pain management', 'Regular heat therapy, including hot baths, warm packs, or infrared heat, may be part of a comprehensive pain management strategy for chronic muscle pain, providing temporary relief and improving muscle relaxation.', '#2K6H8', 7, 'any', 37);
